import React from 'react'
import { Link } from 'react-router-dom'
import {useNavigate} from 'react-router-dom';
// import LoginPage from './LoginPage'
const Navbar = () => {

    const navigate = useNavigate();

    const navigateLogin=()=>{
        console.log("Login Page");
        navigate('/login');
    }

    const navigateSignup=()=>{
        console.log("Signup Page");
        navigate('/signup');
    }
    return (
        <>
            <nav className="navbar navbar-expand-lg navbar-dark bg-success">
                <div className="container-fluid">
                    <Link className="navbar-brand" to="/">Medi Care</Link>
                    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-icon"></span>
                    </button>
                    <div className="collapse navbar-collapse" id="navbarSupportedContent">
                        <ul className="navbar-nav me-auto mb-2 mb-lg-0">
                            <li className="nav-item">
                                <Link to="/home" className="nav-link active" aria-current="page" href="/home">Home</Link>
                            </li>

                            <li className="nav-item">
                                <Link  to="addProduct" className="nav-link active" aria-current="page" href="/addproduct">Add Product</Link>
                            </li>

                           
                        </ul>
                        <ul className="nav navbar-nav navbar-right">
                            <li><button type="button" className="btn btn-info mx-2 my-2" onClick={navigateLogin}>Login</button></li> 
                            <li><button type="button" className="btn btn-info mx-2 my-2" onClick={navigateSignup}>Signup</button></li>
                        </ul>
                    </div>
                </div>
            </nav>
        </>
    )
}

export default Navbar;
